      this.Interval = setInterval(function (e) {
        // console.log('执行')


        time[1]--;
        if (time[1] == -1) {
          if (time[0] != 0) {
            time[1] = 59;
            time[0]--;
          } else {
            time[1] = 0;
            time[0] = 0;
            that.choose = false;
            that.clear();

          }
        }

        var minute = time[0];
        var second = time[1];

        // 前面加个0
        if (time[0] < 10) {
          minute = '0' + time[0];
        }

        if (time[1] < 10) {
          second = '0' + time[1];
        }

        // 渲染一下
        that.timese = minute + ':' + second;

        // console.log(that.timese)

      }, 1000);



